Like everyone else that came before her, Queen had been constantly reminded that leading a normal life was the only way to happiness. Like those before her, normal was considered a droll, minimal ambition and subservience to the powers that be. 
She no longer found solace watching television as this caused the muscles in her chest to clench tightly ever so often. These thoracic tensions were provoked by watching other women do the things she longed and yearned for. Things she could dream of. She made herself a cup of slimming tea she had just bought from the supermarket and sat on the edge of her balcony just to let her thoughts  wander as she would usually do awaiting power supply to be restored in her mini apartment. The cup was now half full and she felt the tension in her chest once more, unapologetically tugging at the muscles, reminding her of her choices to stay normal. She looked up at the night of the sky, as she beheld two crescent moons in her gaze. 
This was inexplicable she thought. It made her weary but she did not panic as she knew it was time to wake up from the persisting dream that veiled her eyes for so long. She knew it was time to create a new dream of her own- and she would have to start with how she perceived herself. A bold fierce and confident woman inspired by the moon.";}i:30;a:1:{s:14:"comments_count";i:1;}i:31;a:1:{s:11:"likes_count";i:6;}i:32;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEulvo7lpzk";}i:33;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118766153_314110033200501_3573183557661747973_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=tRmZwvxBP6MAX8DcIyI&oh=2d974e554841f448d1cda980760c8e4d&oe=5F7D0BE6";}i:34;a:1:{s:4:"type";s:5:"image";}i:35;a:1:{s:8:"owner_id";i:1438486991;}i:36;a:1:{s:14:"owner_username";s:0:"";}i:37;a:1:{s:14:"owner_fullname";s:0:"";}i:38;a:1:{s:9:"owner_pic";s:0:"";}i:39;a:1:{s:2:"id";s:19:"2391014199574333402";}i:40;a:1:{s:10:"short_code";s:11:"CEulr8Siwfa";}i:41;a:1:{s:12:"created_time";i:1599251125;}i:42;a:1:{s:7:"caption";s:262:"#capellibiondi #hair #capelli #hairstyle #haircut #blondehair #haircolor #hairstyles #style #fashion #blonde #instahair #hairideas #parrucchiere #blondegirl #salone #hairstylist #hairdresser #haircolour #me # #coolhair #hairdye #braid #haird #beautiful # #blondh";}i:43;a:1:{s:14:"comments_count";i:0;}i:44;a:1:{s:11:"likes_count";i:0;}i:45;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEulr8Siwfa";}i:46;a:1:{s:5:"image";s:248:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118654671_747728386078950_6263103885045119223_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=nS1sPQl0TP4AX_XLmej&_nc_tp=18&oh=3f39078fbc7c51a95a830ac6d2dc6028&oe=5F7B3A45";}i:47;a:1:{s:4:"type";s:5:"image";}i:48;a:1:{s:8:"owner_id";i:6086614980;}i:49;a:1:{s:14:"owner_username";s:0:"";}i:50;a:1:{s:14:"owner_fullname";s:0:"";}i:51;a:1:{s:9:"owner_pic";s:0:"";}i:52;a: